import ReactDOM from 'react-dom';

import './index.css';
import App from './App';

ReactDOM.render(<App />, document.getElementById('root'));


document.getElementById("AddNew").addEventListener("click", function(event){
    document.getElementsByClassName("expense-item")[document.getElementsByClassName("expense-item").length - 1].parentNode.insertBefore(newElement, document.getElementsByClassName("expense-item")[document.getElementsByClassName("expense-item").length - 1].nextSibling);
})
